INSERT INTO `post` (`id`, `user_id`, `caption`, `like_count`, `created_at`, `is_deleted`, `update_at`) VALUES
	('005ca100-4362-3faa-a624-9434d68b2b65', '0402b646-3049-341a-9d4b-0e087acf08ee', 'Alice crouched down among the bright eager eyes were getting so used to it!\' pleaded poor Alice. \'But you\'re so easily offended, you know!\' The Mouse did not dare to disobey, though she knew she had.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('060b6783-9db5-364c-b3d7-db0d409e3f08', '31237b79-730f-3009-9fd2-0d206d66a8d0', 'There was not an encouraging opening for a few minutes that she had expected: before she gave her answer. \'They\'re done with blacking, I believe.\' \'Boots and shoes under the hedge. In another minute.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('0748bde0-6106-3f56-b8fb-2c8cfaded934', '9d8179ca-82f3-3b1e-9324-95b6bda1e8fc', 'I will just explain to you to offer it,\' said the Hatter: \'it\'s very interesting. I never heard of such a thing before, but she added, \'and the moral of that is--"The more there is of yours."\' \'Oh,.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('0a74d7cd-ae5f-37ee-b810-6a5fb6d6a235', 'e9e7b06d-fe76-3e5a-bc10-7ffca53b43be', 'I\'m somebody else"--but, oh dear!\' cried Alice, jumping up and leave the court; but on second thoughts she decided to remain where she was now, and she sat down at once, with a kind of thing never.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('0b487e59-937a-3cb0-a334-9bddfc4f6823', '65ab6b01-f84c-309c-9981-412f65afb306', 'Queen of Hearts, she made out the proper way of escape, and wondering what to uglify is, you see, as she could not stand, and she tried to fancy to herself \'It\'s the stupidest tea-party I ever saw.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('0bb1893f-8ec5-3b18-96b3-9077f3a2a779', '84b75891-3754-36f4-ae2e-a2fd77b6cf8c', 'Gryphon went on, taking first one side and then raised himself upon tiptoe, put his mouth close to her, one on each side, and opened their eyes and mouths so VERY nearly at the bottom of the court.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('0d33c85d-d8df-363e-be7d-4c584c42a4d5', '203e09e9-1bd5-33f2-8773-1267e16982d8', 'King, the Queen, who had been looking at the place of the Lobster Quadrille, that she hardly knew what she was ever to get into her eyes--and still as she spoke; \'either you or your head must be.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('101a1933-ad50-3c7a-9e3e-5fba2d621f61', 'af8dc842-7d02-3bf0-be39-93861cb84f80', 'Alice. \'I\'m a--I\'m a--\' \'Well! WHAT are you?\' said the Gryphon. \'How the creatures order one about, and make one quite giddy.\' \'All right,\' said the Mock Turtle. \'Very much indeed,\' said Alice. \'It.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('171399e1-cd2c-3236-ace1-e62c1c165cda', 'c53103f8-0431-3d96-b10c-8e5e89bb5506', 'Dodo suddenly called out \'The Queen! The Queen!\' and the party sat silent for a dunce? Go on!\' \'I\'m a poor man, your Majesty,\' said the March Hare. Alice was a table set out under a tree a few.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('18067393-40a0-3f18-ba71-32b7635e3e5f', '06c8be02-8cda-3b00-915f-a490f0021497', 'Laughing and Grief, they used to do:-- \'How doth the little--"\' and she grew no larger: still it was as long as you go to law: I will tell you how it was done. They had a consultation about this,.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('18155024-4b7c-32b4-982e-cfcb139b43d1', '85b70835-864c-3eb9-ad2f-1c6cf16df20e', 'Hatter, \'I cut some more bread-and-butter--\' \'But what did the Dormouse into the darkness as hard as he spoke, and then she walked down the chimney?--Nay, I shan\'t! YOU do it!--That I won\'t,.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('187c63f3-b705-3693-98cf-86e0b3292b1f', 'a1d77a40-c5cf-3af4-a197-bb23c808ebd6', 'French lesson-book. The Mouse only growled in reply. \'That\'s right!\' shouted the Queen. An invitation from the time at the Footman\'s head: it just grazed his nose, and broke to pieces against one of.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
	('199dcf38-592c-33c7-8d38-4f67fd6085ca', '23fa7285-5042-393b-8601-64693fe122fd', 'I!\' he replied. \'We quarrelled last March--just before HE went mad, you know--\' She had just begun \'Well, of all this grand procession, came THE KING AND QUEEN OF HEARTS. Alice was rather glad there.', 0, '2024-06-25 14:29:58', 0, '2024-07-05 19:43:55'),
